import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import React from 'react';
import MyComponent from './MyComponent';

function App() {
  return (
    <div
      style={{
        backgroundImage: `url("https://t4.ftcdn.net/jpg/03/45/88/07/360_F_345880772_zIT2mkdCzTthplO7xqaGGrMspN0jw0ll.jpg")`,
        backgroundSize: 'cover', // To make the background image cover the entire page
        backgroundRepeat: 'no-repeat', // To prevent the background image from repeating
        height: '100vh', // Set the height of the container to fit the entire viewport
      }}
    >
      <MyComponent />
    </div>
  );
}

export default App;
